import React from 'react';

export default class UseLocalStorage {
    setTimeline(timeline: string): void {
        localStorage.setItem('timelineList', timeline);
    }

    getData(): string {
        var data = localStorage.getItem('timelineList');
        var obj = JSON.stringify(data.datetime)
        return obj;
    }

    getGender(gender: string): string {
        return gender;
    }

    getAge(): number {
        return 50;
    }
}
